import React from 'react';
import ReactDOM from 'react-dom';
import LifeCycles from './components/LifeCycles';
class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      number1: 0,
      number2: 0,
      result: 0

    }
  }
  incrementState = () => {
    this.setState({number1: this.state.number1+1});
    this.setState({number2: this.state.number2+1});
  }
  decrementState = () => {
    this.setState({number1: this.state.number1-1});
  }

  render(){
    return (
      <div>

        <button onClick={this.incrementState}> Increment</button>
        <button onClick={this.decrementState}> Decrement</button>
        <h1>{this.state.number1}+" + "{this.state.number2}</h1>

      </div>
    )
  }

}


ReactDOM.render(
  <App/>,
  document.getElementById('root')

);
